import ExpenseItem from "./Component/ExpenseItems";

function App() {

  const expenseDate = new Date(2022,7,2);
  const expenseTitle = 'Car Insurance';
  const expenseAmount = 295.35;

  return (
    <div>
      {/* <ExpenseItem title = {expenseTitle} date = {expenseDate} amount = {expenseAmount}><ExpenseItem/> */}
      <ExpenseItem title = {expenseTitle} date = {expenseDate} amount = {expenseAmount}><ExpenseItem/></ExpenseItem>
    </div>
  )
}

export default App;
